  };
  const handleChest2 = () => {
    navigate("/pirate/stage4/door2/chest2");
  };
  const handleChest3 = () => {
    navigate("/pirate/stage4/door3/chest3");
  };

  return (
    <div id="ChestListDiv">
      <a onClick={handleChest1}>
        <Chest />
      </a>
      <a onClick={handleChest2}>
        <Chest />
      </a>
      <a onClick={handleChest3}>
        <Chest />
      </a>
    </div>
  );
};

export default Door1;
